  //     </>
  //   );
  //   return design;
  // }
  const NewItem = (FData)=>{
    <h1>{FData.itemData.label}</h1>
  }
  const[data,setData] = useState("HELLO");
  const design = (
    <>
    <h1>{data}</h1>
    <button onClick={()=>setData("WAP")}>Click</button>
    {
      Menu.map((item)=>{
        return <NewItem itemData={item} />
      })
    }
    </>
  );
  return design;
}

export default App;
